import "./App.css";
import Paper from "@mui/material/Paper";

function App() {
  return (
    <div className="App">
      <div className="App-header">
        <Paper elevation={3} className="header">
          <img className="icon" src="logo192.png" alt="..." />
        </Paper>
        <div className="body"></div>
      </div>
    </div>
  );
}

export default App;
